planApp.descr:
Hybrid application for comprehensive mixed-use redevelopment of Wood Wharf comprising:
1) Outline Application (all matters reserved, save for access & layout)
Demolition of dwellings at Lovegrove Walk; 
Commercial floorspace (B1), up to 1668 residential units (C3), and hotel (C1) contained in fourteen buildings; 
Retail (A1), financial services (A2), restaurants & cafes (A3), drinking establishments (A4) and takeaway establishments (A5); 
Leisure & community uses (D1 & D2); 
Associated infrastructure, including the creation of structures in Blackwall Basin and South Dock; 
Principles of landscaping and public realm; 
Means of access; 
Bridge links; 
Car, motorcycle and bicycle parking spaces, servicing; and 
Electricity substation. 

2) Full Application

Creation of canal and other engineering infrastructure.

Application for internal and external refurbishment works to numbers 43 ? 55 Philpot Street and 33 ? 51 Walden Street; 
the erection of garden rooms at numbers 49 Philpot Street and 33, 37, 39, 41, 45 Walden Street; 
the change of use of numbers 43, 49, 51, 53, 55 Philpot Street and 51 Walden Street from office (Class B1) to residential (Class C3); 
the demolition and reconstruction of nos. 33, 35 and 37 Walden Street behind a retained facade and a two storey addition to the rear of 33 Walden Street
associated landscaping, works to trees and other ancillary works
